import React from 'react';
import styled from 'styled-components';

const TodoHeadBox = styled.div`
  padding: 40px 32px 20px;
  border-bottom: 1px solid #e9ecef;
  border: 1px solid red;

  h1{
    margin: 0;
    font-size: 36px;
    color: #343a40;
  }
  .day {
    margin-top: 4px;
    color: #868e96;
    font-size: 21px;
  }
  .tasks{
    color: #49C5B6;
    font-size: 18px;
    margin-top: 40px;
    font-weight: bold;
  }
`;

function TodoHead(){

  return(
    <TodoHeadBox>
      <h1>2020.01.05</h1>
      <div className="day"></div>
      <div className="tasks">할일 몇개 남음</div>
    </TodoHeadBox>
  );
}

export default TodoHead();
